int DOMTest_Odf_Note (OSCTXT* pctxt, Odf_Note* pvalue, 
   xmlNodePtr pXmlNode, OSBOOL setChild)
{
   xmlAttrPtr pXmlAttr = pXmlNode->properties;

   /* Populate attributes */
   for ( ; 0 != pXmlAttr; pXmlAttr = pXmlAttr->next) {
      if (pXmlAttr->type == XML_ATTRIBUTE_NODE) {
         if (rtxUTF8StrEqual (pXmlAttr->name, OSUTF8("id"))) {
            pvalue->m.idPresent = 1;
            if (0 != ((xmlNodePtr)pXmlAttr)->children) {
               pvalue->id = ((xmlNodePtr)pXmlAttr)->children->content;
            }
            else {
               pvalue->id = (const OSUTF8CHAR*)"";
            }
         }
         else if (rtxUTF8StrEqual (pXmlAttr->name, OSUTF8("note-class"))) {
            if (0 != ((xmlNodePtr)pXmlAttr)->children) {
               Odf_Note_note_class_ToEnum (pctxt, ((xmlNodePtr)pXmlAttr)->children->content, &pvalue->note_class);
            }
         }
      }
   }
   /* Populate elements */
   if (setChild)
      pXmlNode = pXmlNode->children;

   for ( ; 0 != pXmlNode; pXmlNode = pXmlNode->next) {
      if (pXmlNode->type == XML_ELEMENT_NODE) {
         if (rtxUTF8StrEqual (pXmlNode->name, OSUTF8("note-citation"))) {
            DOMTest_Odf_Note_citation (pctxt, &pvalue->note_citation, pXmlNode, TRUE);
         }
         else if (rtxUTF8StrEqual (pXmlNode->name, OSUTF8("note-body"))) {
            DOMTest_Odf_Note_body (pctxt, &pvalue->note_body, pXmlNode, TRUE);
         }
      }
   }

   return 0;
}

